import React from 'react';
import PageLayout from '../../components/PageLayout';
import HeroSection from '../../components/HeroSection';
import InfoCard from '../../components/InfoCard';
import ChakraDiagram from '../../components/ChakraDiagram';
import ChakraData from '../../data/chakraData';
const Chakras = () => {
  return (
    <PageLayout>
      <HeroSection
        title="Chakras"
        subtitle="Energy Centers of the Body"
        description="Explore the frequencies, colors, emotions, and organs associated with each chakra. Learn how these ancient energy centers correspond to your physical and emotional well-being."
      />

      <section className="flex flex-col items-center px-4 py-8 md:px-12 lg:px-24">
        <ChakraDiagram className="max-w-2xl w-full mb-12" />

        <div className="grid grid-cols-1 sm:grid-cols-2 lg:grid-cols-3 gap-6 w-full">
          {chakraData.map((chakra, index) => (
            <InfoCard
              key={index}
              title={chakra.name}
              subtitle={`Frequency: ${chakra.frequency} Hz`}
              image={chakra.image}
              content={
                <ul className="text-sm space-y-1">
                  <li><strong>Color:</strong> {chakra.color}</li>
                  <li><strong>Location:</strong> {chakra.location}</li>
                  <li><strong>Element:</strong> {chakra.element}</li>
                  <li><strong>Emotion:</strong> {chakra.emotion}</li>
                  <li><strong>Organs:</strong> {chakra.organs}</li>
                  <li><strong>Imbalances:</strong> {chakra.imbalances}</li>
                  <li><strong>Tips:</strong> {chakra.tips}</li>
                </ul>
              }
            />
          ))}
        </div>
      </section>
    </PageLayout>
  );
};

export default Chakras;
